import React from 'react';
import './Face.css';

const Face = ({ topRow, rightCol, bottomRow, leftCol }) => {
    return (
        <div>
            <div className='bounding-box' style={{top: topRow, right: rightCol, bottom: bottomRow, left: leftCol}}></div>
        </div>
    )
}

export default Face;
